import Nav from "./Nav";
import Head from "next/head";
import Weather from '../components/Weather';

const Layout = (props) => (
    <div>
      <Head>
        <title>nextWeather</title>
        <link rel="icon" href=""/>
      </Head>
      <Nav />
      <p>{Object.keys(this.props.weather.list).map((key, index) => {
                            return(
                                <option value={this.props.weather.list[key]}>{key}</option>
                            )
                        })} </p>
    </div>
)

export default Layout;
